import React, { useState } from 'react';
import Car from './Components/Car';

const App = () => {
  const [carList, setCarList] = useState([
    {
      car: 'Audi'
    },
    {
      car: 'BMW'
    },
    {
      car: 'Porsche'
    }
  ]);

  let tmpCarValue = '';

  const pushCar = (value) => {
    if (value !== undefined) {
      setCarList(prevCarList => [...prevCarList, { car: value }]);
    }
  };

  return (
    <div className="App">
      <input onChange={(v) => tmpCarValue = v.target.value} type="text" />
      <button onClick={pushCar(tmpCarValue)}>Добавить</button>
      {carList.map((e) => (
        <Car key={e.car} name={e.car} />
      ))}
    </div>
  );
};

export default App;
